DROP TABLE IF EXISTS `batoo_id`;
DROP TABLE IF EXISTS `Student_Course`;
DROP TABLE IF EXISTS `Course`;
DROP TABLE IF EXISTS `Student`;
DROP TABLE IF EXISTS `Teacher`;
DROP TABLE IF EXISTS `Person`;

CREATE TABLE `batoo_id` (`name` varchar(255) NOT NULL DEFAULT '', `next_id` int(11) DEFAULT NULL, PRIMARY KEY (`name`)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
INSERT INTO `batoo_id` VALUES ('batoo_id',1001);

CREATE TABLE `Person` (`createdOn` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP, `id` bigint(20) NOT NULL DEFAULT '0', `modifiedOn` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00', `lastName` varchar(25) NOT NULL, `firstName` varchar(25) NOT NULL, `PERSON_TYPE` varchar(3), PRIMARY KEY (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE `Student` (`id` bigint(20) NOT NULL DEFAULT '0', `gpa` float DEFAULT NULL, PRIMARY KEY (`id`), CONSTRAINT `FK_1D90C76` FOREIGN KEY (`id`) REFERENCES `Person` (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE `Teacher` (`id` bigint(20) NOT NULL DEFAULT '0', PRIMARY KEY (`id`), CONSTRAINT `FK_5C60885D` FOREIGN KEY (`id`) REFERENCES `Person` (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE `Course` (`createdOn` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP, `id` bigint(20) NOT NULL DEFAULT '0', `modifiedOn` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00', `title` varchar(32) NOT NULL, `teacher_id` bigint(20) DEFAULT NULL, `code` varchar(8) NOT NULL, PRIMARY KEY (`id`), KEY `FK_A6C42C13` (`teacher_id`), CONSTRAINT `FK_A6C42C13` FOREIGN KEY (`teacher_id`) REFERENCES `Person` (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE `Student_Course` (`Person_id` bigint(20) DEFAULT NULL, `Course_id` bigint(20) DEFAULT NULL, KEY `FK_917CA944` (`Person_id`), KEY `FK_B600E6BE` (`Course_id`), CONSTRAINT `FK_B600E6BE` FOREIGN KEY (`Course_id`) REFERENCES `Course` (`id`), CONSTRAINT `FK_917CA944` FOREIGN KEY (`Person_id`) REFERENCES `Person` (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1;

